import React from 'react';

const Sdata = (props) => {
  //   const imsSrc = `https://source.unsplash.com/400x300/?${props.name}`;
  const imsSrc = `https://picsum.photos/400x300/?${props.name}`;
  return (
    <div className='img_div'>
      <img src={imsSrc} alt='img' />
    </div>
  );
};

export default Sdata;
